import React, { useState } from 'react'
import { Routes,Route,Link, useNavigate } from 'react-router-dom'
import Notes from './Notes'
import { useDispatch } from 'react-redux' 
import {click} from '../features/notes'
import { toggle } from '../features/categoryBar'

const Navbar = () => {
    const dispatch = useDispatch()
    let navigate = useNavigate()
    const handleImage = () => {
        dispatch(click({
            isNotesClicked:false
        })) 
         navigate('/', {replace: true}) 
        dispatch(toggle({isNotesClicked:false}))
        dispatch(toggle({isBtn1Clicked:true}))
    }

    const handleNote = () => {
        dispatch(click({
            isNotesClicked:true }));
             navigate('/notes', {replace: true}) ;
             dispatch(toggle({isNotesClicked:true}))
    }

    return (
        <div className=''  >
            <nav className="navbar navbar-dark bg-dark " >
                <div className="container-fluid ">
                    {/* <img className="navbar-brand" src={Logo} /> */}
                    <Link to="/collection">
                    <img src="data:image/jpeg;base64," alt="finance" width={50} height={50} onClick={handleImage}/>
                    </Link>
                    <div className="d-flex ">
                        {/* <button  className='btn btn-outline-warning ' onClick={() => dispatch(click({
            isNotesClicked:true })) && navigate('/notes', {replace: true}) && dispatch(toggle({isNotesClicked:true}))}>Notes</button> */}
                        <button  className='btn btn-outline-warning ' onClick={handleNote}>Notes</button>
                        <button className="btn btn-outline-danger ms-2" type="submit">Logout</button>
                    </div>
                </div>
            </nav>
            <Routes>
                <Route path="/notes"  element={<Notes />}/>
            </Routes>
        </div>
    )
}

export default Navbar
